import React, { useState } from "react";
import {
  FaMapMarkedAlt,
  FaUsers,
  FaStar,
  FaGlobe,
  FaFacebook,
  FaInstagram,
} from "react-icons/fa";
import emailjs from "@emailjs/browser";
import { useTranslation } from "react-i18next";

const Aboutus = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [form, setForm] = useState({ name: "", email: "", message: "" });
  const phoneNumber = "403-604-9794";
  const contactEmail = "info@example.com";
  const { t } = useTranslation();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prevForm) => ({
      ...prevForm,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const templateParams = {
      from_name: form.name,
      from_email: form.email,
      message: form.message,
    };

    emailjs
      .send(
        "service_g1dka7g",
        "template_thwyahw",
        templateParams,
        "8xsBRcAMM1CUEbrR4"
      )
      .then(
        () => {
          alert(t("messageSent"));
          setForm({ name: "", email: "", message: "" });
        },
        () => {
          alert(t("messageFailed"));
        }
      );
  };

  return (
    <div className="bg-gray-100">
      {/* Hero Section */}
      <div className="max-w-5xl mx-auto py-16 px-6 text-center">
        <h2 className="text-4xl font-bold text-gray-800">{t("ourStory")}</h2>
        <p className="mt-4 text-lg text-gray-600">
          {t("ourStoryDesc")}
        </p>
      </div>

      {/* Why Choose Us Section */}
      <div className="bg-white py-16 px-6">
        <div className="max-w-6xl mx-auto text-center">
          <h2 className="text-4xl font-bold text-gray-800">
            {t("whyChooseUs")}
          </h2>
          <div className="mt-10 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">
            {/* Cards with icons */}
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaMapMarkedAlt className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">{t("expertGuidance")}</h3>
              <p className="text-gray-600 mt-2">{t("expertGuidanceDesc")}</p>
            </div>
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaUsers className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">{t("personalizedService")}</h3>
              <p className="text-gray-600 mt-2">{t("personalizedServiceDesc")}</p>
            </div>
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaStar className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">{t("topRatedDestinations")}</h3>
              <p className="text-gray-600 mt-2">{t("topRatedDestinationsDesc")}</p>
            </div>
            <div className="flex flex-col items-center text-center p-6 bg-gray-50 shadow-md rounded-lg">
              <FaGlobe className="text-blue-600 text-5xl mb-4" />
              <h3 className="text-xl font-semibold">{t("globalReach")}</h3>
              <p className="text-gray-600 mt-2">{t("globalReachDesc")}</p>
            </div>
          </div>
        </div>
      </div>

      {/* Call to Action */}
      <div className="bg-blue-600 text-white py-16 px-6 flex flex-col lg:flex-row items-center justify-center w-full">
        <div className="text-center flex flex-col items-center lg:w-2/3">
          <h2 className="text-4xl font-bold">{t("readyToStart")}</h2>
          <p className="mt-4 text-lg">{t("dreamVacation")}</p>
          <div className="flex justify-center space-x-4 mt-4">
            <a
              href="https://facebook.com"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaFacebook className="text-3xl text-white" />
            </a>
            <a
              href="https://instagram.com"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaInstagram className="text-3xl text-white" />
            </a>
          </div>
          <p className="mt-4 text-lg">
            <a href={`mailto:${contactEmail}`} className="underline">
              {contactEmail}
            </a>
          </p>
        </div>

        {/* Form Section */}
        <form
          onSubmit={handleSubmit}
          className="bg-white p-6 shadow-md rounded-lg w-full lg:w-1/3 mt-6 lg:mt-0"
          autoComplete="on"
        >
          <input
            type="text"
            name="name"
            placeholder={t("yourName")}
            value={form.name}
            onChange={handleChange}
            className="w-full p-3 border rounded mb-3 focus:outline-none focus:ring-2 focus:ring-blue-500 text-gray-800"
            required
            autoComplete="name"
          />
          <input
            type="email"
            name="email"
            placeholder={t("yourEmail")}
            value={form.email}
            onChange={handleChange}
            className="w-full p-3 border rounded mb-3 focus:outline-none focus:ring-2 focus:ring-blue-500 text-gray-800"
            required
            autoComplete="email"
          />
          <textarea
            name="message"
            placeholder={t("yourMessage")}
            value={form.message}
            onChange={handleChange}
            className="w-full p-3 border rounded mb-3 focus:outline-none focus:ring-2 focus:ring-blue-500 text-gray-800"
            required
            autoComplete="off"
          ></textarea>
          <button
            type="submit"
            className="w-full p-3 bg-blue-600 text-white rounded hover:bg-blue-700"
          >
            {t("send")}
          </button>
        </form>
      </div>
    </div>
  );
};

export default Aboutus;
